import React, { useState, useEffect } from 'react';
import '../styles/login-signup.css';

const NeuralChatAuth = () => {
  const [activeTab, setActiveTab] = useState('login');
  const [showPassword, setShowPassword] = useState({
    login: false,
    signup: false,
    confirm: false
  });
  const [loading, setLoading] = useState({
    login: false,
    signup: false
  });
  const [notification, setNotification] = useState({
    show: false,
    message: '',
    type: 'success'
  });

  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    password: '',
    confirmPassword: '',
    rememberMe: false,
    agreeTerms: false
  });

  const showNotification = (message, type = 'success') => {
    setNotification({ show: true, message, type });
    setTimeout(() => {
      setNotification(prev => ({ ...prev, show: false }));
    }, 4000);
  };

  const togglePassword = (field) => {
    setShowPassword(prev => ({
      ...prev,
      [field]: !prev[field]
    }));
  };

  const handleInputChange = (field, value) => {
    setFormData(prev => ({
      ...prev,
      [field]: value
    }));
  };

  const handleLogin = async () => {
    setLoading(prev => ({ ...prev, login: true }));

    setTimeout(() => {
      setLoading(prev => ({ ...prev, login: false }));
      showNotification('This is a demo login page for NeuralChat AI. In a real application, this would authenticate your credentials and redirect you to the AI dashboard.', 'error');
    }, 2000);
  };

  const handleSignup = async () => {
    setLoading(prev => ({ ...prev, signup: true }));

    setTimeout(() => {
      setLoading(prev => ({ ...prev, signup: false }));
      showNotification('This is a demo signup page for NeuralChat AI. In a real application, this would create your account and set up your AI assistant.', 'error');
    }, 2500);
  };

  const handleSocialLogin = (provider) => {
    showNotification(`This is a demo page. In a real NeuralChat AI application, this would connect to ${provider} for quick authentication.`, 'error');
  };

  const aiFeatures = [
    {
      icon: 'fas fa-comments',
      title: 'Intelligent Conversations',
      description: 'Natural language processing with context awareness',
      gradient: 'from-blue-500 to-purple-600'
    },
    {
      icon: 'fas fa-code',
      title: 'Code Generation',
      description: 'Write, debug, and optimize code in any language',
      gradient: 'from-green-500 to-blue-500'
    },
    {
      icon: 'fas fa-lightbulb',
      title: 'Creative Solutions',
      description: 'Innovative ideas and creative problem solving',
      gradient: 'from-purple-500 to-pink-500'
    },
    {
      icon: 'fas fa-shield-alt',
      title: 'Secure & Private',
      description: 'End-to-end encryption and data protection',
      gradient: 'from-orange-500 to-red-500'
    }
  ];

  return (
    <div className="auth-container">
      {/* Floating Background Shapes */}
      <div className="fixed-background">
        <div className="floating-shape"></div>
        <div className="floating-shape"></div>
        <div className="floating-shape"></div>
      </div>

      {/* Neural Network Background */}
      <div className="neural-background">
        <svg width="100%" height="100%" viewBox="0 0 1000 1000">
          <defs>
            <pattern id="grid" width="50" height="50" patternUnits="userSpaceOnUse">
              <path d="M 50 0 L 0 0 0 50" fill="none" stroke="rgba(114, 9, 183, 0.1)" strokeWidth="1"/>
            </pattern>
          </defs>
          <rect width="100%" height="100%" fill="url(#grid)" />
        </svg>
      </div>

      {/* Notification */}
      <div className={`notification ${notification.show ? 'show' : ''} ${notification.type}`}>
        {notification.message}
      </div>

      <div className="auth-content">
        {/* AI Features Section */}
        <div className="features-section">
          <div className="features-header">
            <div className="ai-logo">
              <i className="fas fa-brain"></i>
            </div>
            <h1>NeuralChat AI</h1>
            <p>Next-Generation AI Assistant Platform</p>
          </div>

          <div className="features-grid">
            {aiFeatures.map((feature, index) => (
              <div key={index} className="ai-feature">
                <div className="feature-content">
                  <div className={`feature-icon ${feature.gradient}`}>
                    <i className={feature.icon}></i>
                  </div>
                  <div className="feature-text">
                    <h3>{feature.title}</h3>
                    <p>{feature.description}</p>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>

        {/* Auth Form Section */}
        <div className="auth-form-section">
          <div className="auth-form-container">
            {/* Decorative Elements */}
            <div className="decorative-gradient top-right"></div>
            <div className="decorative-gradient bottom-left"></div>

            {/* Toggle Buttons */}
            <div className="auth-tabs">
              <button 
                onClick={() => setActiveTab('login')}
                className={`tab-button ${activeTab === 'login' ? 'tab-active' : ''}`}
              >
                <i className="fas fa-sign-in-alt"></i>Login
              </button>
              <button 
                onClick={() => setActiveTab('signup')}
                className={`tab-button ${activeTab === 'signup' ? 'tab-active' : ''}`}
              >
                <i className="fas fa-user-plus"></i>Sign Up
              </button>
            </div>

            {/* Login Form */}
            {activeTab === 'login' && (
              <div className="form-slide-enter">
                <div className="form-header">
                  <div className="form-icon purple-blue">
                    <i className="fas fa-robot"></i>
                  </div>
                  <h2>Welcome Back!</h2>
                  <p>Continue your AI journey</p>
                </div>

                <div className="form-fields">
                  <div className="form-field">
                    <label>
                      <i className="fas fa-envelope"></i>Email Address
                    </label>
                    <input 
                      type="email" 
                      placeholder="Enter your email"
                      value={formData.email}
                      onChange={(e) => handleInputChange('email', e.target.value)}
                    />
                  </div>

                  <div className="form-field">
                    <label>
                      <i className="fas fa-lock"></i>Password
                    </label>
                    <div className="password-input">
                      <input 
                        type={showPassword.login ? 'text' : 'password'}
                        placeholder="Enter your password"
                        value={formData.password}
                        onChange={(e) => handleInputChange('password', e.target.value)}
                      />
                      <button 
                        type="button"
                        onClick={() => togglePassword('login')}
                        className="password-toggle"
                      >
                        <i className={`fas ${showPassword.login ? 'fa-eye-slash' : 'fa-eye'}`}></i>
                      </button>
                    </div>
                  </div>

                  <div className="form-options">
                    <label className="remember-me">
                      <input 
                        type="checkbox"
                        checked={formData.rememberMe}
                        onChange={(e) => handleInputChange('rememberMe', e.target.checked)}
                      />
                      Remember me
                    </label>
                    <a href="#" className="forgot-password">
                      <i className="fas fa-question-circle"></i>Forgot password?
                    </a>
                  </div>

                  <button 
                    onClick={handleLogin}
                    className="submit-button"
                    disabled={loading.login}
                  >
                    {loading.login ? (
                      <div className="loading-spinner"></div>
                    ) : (
                      <>
                        <i className="fas fa-rocket"></i>Access AI Dashboard
                      </>
                    )}
                  </button>
                </div>

                <div className="form-footer">
                  <p>
                    New to NeuralChat AI? 
                    <button 
                      onClick={() => setActiveTab('signup')}
                      className="text-link"
                    >
                      Create account
                    </button>
                  </p>
                </div>
              </div>
            )}

            {/* Signup Form */}
            {activeTab === 'signup' && (
              <div className="form-slide-enter">
                <div className="form-header">
                  <div className="form-icon green-blue">
                    <i className="fas fa-brain"></i>
                  </div>
                  <h2>Join NeuralChat AI</h2>
                  <p>Start your AI-powered journey today</p>
                </div>

                <div className="form-fields">
                  <div className="name-fields">
                    <div className="form-field">
                      <label>
                        <i className="fas fa-user"></i>First Name
                      </label>
                      <input 
                        type="text"
                        placeholder="John"
                        value={formData.firstName}
                        onChange={(e) => handleInputChange('firstName', e.target.value)}
                      />
                    </div>
                    <div className="form-field">
                      <label>
                        <i className="fas fa-user"></i>Last Name
                      </label>
                      <input 
                        type="text"
                        placeholder="Doe"
                        value={formData.lastName}
                        onChange={(e) => handleInputChange('lastName', e.target.value)}
                      />
                    </div>
                  </div>

                  <div className="form-field">
                    <label>
                      <i className="fas fa-envelope"></i>Email Address
                    </label>
                    <input 
                      type="email"
                      placeholder="Enter your email"
                      value={formData.email}
                      onChange={(e) => handleInputChange('email', e.target.value)}
                    />
                  </div>

                  <div className="form-field">
                    <label>
                      <i className="fas fa-lock"></i>Password
                    </label>
                    <div className="password-input">
                      <input 
                        type={showPassword.signup ? 'text' : 'password'}
                        placeholder="Create a strong password"
                        value={formData.password}
                        onChange={(e) => handleInputChange('password', e.target.value)}
                      />
                      <button 
                        type="button"
                        onClick={() => togglePassword('signup')}
                        className="password-toggle"
                      >
                        <i className={`fas ${showPassword.signup ? 'fa-eye-slash' : 'fa-eye'}`}></i>
                      </button>
                    </div>
                  </div>

                  <div className="form-field">
                    <label>
                      <i className="fas fa-lock"></i>Confirm Password
                    </label>
                    <div className="password-input">
                      <input 
                        type={showPassword.confirm ? 'text' : 'password'}
                        placeholder="Confirm your password"
                        value={formData.confirmPassword}
                        onChange={(e) => handleInputChange('confirmPassword', e.target.value)}
                      />
                      <button 
                        type="button"
                        onClick={() => togglePassword('confirm')}
                        className="password-toggle"
                      >
                        <i className={`fas ${showPassword.confirm ? 'fa-eye-slash' : 'fa-eye'}`}></i>
                      </button>
                    </div>
                  </div>

                  <div className="terms-checkbox">
                    <input 
                      type="checkbox"
                      checked={formData.agreeTerms}
                      onChange={(e) => handleInputChange('agreeTerms', e.target.checked)}
                      id="agreeTerms"
                    />
                    <label htmlFor="agreeTerms">
                      I agree to the <a href="#" className="terms-link">Terms of Service</a> and <a href="#" className="terms-link">Privacy Policy</a>
                    </label>
                  </div>

                  <button 
                    onClick={handleSignup}
                    className="submit-button"
                    disabled={loading.signup}
                  >
                    {loading.signup ? (
                      <div className="loading-spinner"></div>
                    ) : (
                      <>
                        <i className="fas fa-rocket"></i>Start AI Journey
                      </>
                    )}
                  </button>
                </div>

                <div className="form-footer">
                  <p>
                    Already have an account? 
                    <button 
                      onClick={() => setActiveTab('login')}
                      className="text-link"
                    >
                      Sign in here
                    </button>
                  </p>
                </div>
              </div>
            )}

            {/* Social Login Options */}
            <div className="social-login">
              <div className="divider">
                <span>Or continue with</span>
              </div>

              <div className="social-buttons">
                <button onClick={() => handleSocialLogin('Google')} className="social-btn">
                  <i className="fab fa-google"></i>
                </button>
                <button onClick={() => handleSocialLogin('GitHub')} className="social-btn">
                  <i className="fab fa-github"></i>
                </button>
                <button onClick={() => handleSocialLogin('Microsoft')} className="social-btn">
                  <i className="fab fa-microsoft"></i>
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default NeuralChatAuth;
